With this update;
    • With the renewed Instant Limit, you can see personalized campaigns and quickly find out your updated limits by making a bulk application at once for credit products that do not have an available instant limit. (Features are being rolled out gradually.)

    • Corporate customers can now create installment payment records for Banko transactions and apply bulk discounts to Banko receivables they wish to collect before maturity.
